import Post from '../Post/Post'
import s from './stylePostContainer.module.css'

export default function PostContainer({cardsPosts, switch_like}) {
  return (
    <div className={s.item}>
        {
        cardsPosts.map(el => <Post key={el.id} {...el}/>)
        }
    </div>
  )
}
